<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Frizqy Mahrizal</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Roboto+Mono:ital,wght@0,100..700;1,100..700&display=swap" rel="stylesheet">


    <style>
        :root{
            --SnugCottage : #FEF9E1;
            --black : #000000;
            --black20 :rgba(0, 0, 0, 0.2);
            --AzukiRed : #6D2323;
            --WellRead : #8F3434;
        }

        html{
            margin: 0;
            padding: 0;
            background-color: var(--SnugCottage);
        }
        footer{
            margin: 0;
            padding: 0;
        }
        p{
            font-family: "Roboto Mono", serif;
            font-optical-sizing: auto;
            font-style: normal;
            color: var(--black);
        }
        section{
            width: 100%;
            height: 100vh;
            align-items: center;
            justify-content: center;
        }
        section p{
            font-size: 50px;
        }
        section div p{
            font-size: 50px;
        }
        section div div p{
            font-size: 50px;
        }
        .home{
            display: flex;
        }
        .about div{
            width: 90%;
            height: auto;
        }
        .skill{
            height: auto;
            text-align: center;
        }
        .skill div{
            display: flex;
            align-items: center;
            justify-content: center;
            flex-direction: column;
        }
        .skill img{
            width: auto;
            height: 200px;
        }
        .project{
            text-align: center;
        }
        .project div img{
            width: 200px;
        }
        @media screen and (max-width: 512px) {
            .home div div svg{
                width: 100px;
                height: auto;
            }
            section div p{
            font-size: 25px;
            }
            section div div p{
                font-size: 25px;
            }
        }
    </style>
</head>
